import styled from 'styled-components';

const CallsBorder = styled.div`
overflow: hidden;
background: transparent;
margin: 15px 0px;
position: absolute;
left: 25%;
width: 20%;
height: 240px;

border-right: 2px solid black;
`
const RideName = styled.div`
text-align: center;
font-size: 30px;
`

const PauseButton = styled.button`
margin-top: 70px;
margin-left: 20px;
justify-content: center;
height: 17%;
width: 85%;
border: 2px solid black;
background: transparent;
`
const EndButton = styled.button`
margin-top: 2px;
margin-left: 20px;
justify-content: center;
height: 17%;
width: 85%;
border: 2px solid black;
background: transparent;
`
const AddIntervalsBorder = styled.tr`
overflow: hidden;
background: transparent;
margin: 15px 0px;
position: absolute;
left: 45%;
width: 44%;
height: 240px;
border: 3px solid blue;
overflow: hidden;
overflow-x: scroll;
white-space: nowrap;
`;


const IntervalCard = styled.div`
width: 20%;;
height: 100%;
border-right: 2px solid black;
display: inline-block;
`
const CardTime = styled.div`
position: absolute;
top: 0%;
height: 15%;
width: 20%;
border-bottom: 2px solid black;
text-align: center;
border-bottom: 2px solid black;
font-size: 150%;
font-weight: bold;
`
const CardCollect = styled.div`
position: absolute;
top: 15%;
height: 30%;
width: 20%;
border-bottom: 2px solid black;
text-align: left;
font-size: 120%;
font-weight: bold;
`


const CardStarting = styled.div`
position: absolute;
top: ;
height: ;
width: 20%;
border-bottom: 2px solid black;
text-align: left;
font-size: 120%;
font-weight: bold;
`
const CardEnding = styled.div`
position: absolute;
top: 80%;
height: 20%;
width: 20%;
border-bottom: 2px solid black;
text-align: left;
font-size: 120%;
font-weight: bold;
`
const CardH = styled.h1`
position: absolute;
left: 0%;
top: 0%;
margin-top: 3px;
margin-left: 3px;
`
const AttractionIntervals = () => {
    return (
        <>

            <CallsBorder>
                <RideName>The Joker</RideName>
                <PauseButton> Pause Calls </PauseButton>
                <EndButton> End Todays Calls </EndButton>
            </CallsBorder>

            <AddIntervalsBorder>
            <IntervalCard>
                <CardTime>Every 60 Minutes</CardTime>
                <CardCollect>Collect <li>Wait Time</li><li>Throughput</li></CardCollect>

                <CardStarting>Starting<ul>At Park Opening</ul></CardStarting>
                <CardEnding>Ending<ul>At Park Closing</ul></CardEnding>
            </IntervalCard>

            </AddIntervalsBorder>

        </>
    )
}

export default AttractionIntervals
